def crc3_gsm(data: bytes) -> int:
    poly = 0x03  # x^3 + x + 1
    crc = 0x00   # 初始值
    xorout = 0x07  # 最终 XOR 值

    for byte in data:
        for _ in range(8):  # 处理每个字节的 8 位
            bit = (crc & 0x04) != 0
            crc <<= 1
            if byte & 0x80:
                bit = not bit
            if bit:
                crc ^= poly
            byte <<= 1

    #crc = (crc << 1) | (crc >> 2)  # 调整 CRC 宽度为 3 位
    crc ^= xorout  # 应用最终 XOR 值

    return crc & 0x07  # 确保结果是 3 位

